import Repository, { apiUrl } from './Repository';

class AuthRepository {
    constructor(callback) {
        this.callback = callback;
    }
    async getActiveExams(payload) {
        const reponse = await Repository.get(`${apiUrl}/examinationCalendar/sub?status='Y'examId=${payload.examId}_start=${payload._start}&_limit=${payload._limit}`)
            .then(response => {
                return response.data;
            })
            .catch(error => ({ error: JSON.stringify(error) }));
        return reponse;
    }
    async getInactiveExams(payload) {
        const reponse = await Repository.get(`${apiUrl}/examinationCalendar/sub?status='N'examId=${payload.examId}_start=${payload._start}&_limit=${payload._limit}`)
            .then(response => {
                return response.data;
            })
            .catch(error => ({ error: JSON.stringify(error) }));
        return reponse;
    }
    async getActiveMain(payload) {
        const reponse = await Repository.get(`${apiUrl}/examinationCalendar/main?status=${'Y'}&&_start=${payload._start}&_limit=${payload._limit}`)
            .then(response => {
                return response.data;
            })
            .catch(error => ({ error: JSON.stringify(error) }));
        return reponse;
    }
    async getInactiveMain(payload) {
        const reponse = await Repository.get(`${apiUrl}/examinationCalendar/main?status=${'N'}&&_start=${payload._start}&_limit=${payload._limit}`)
            .then(response => {
                return response.data;
            })

            .catch(error => ({ error: JSON.stringify(error) }));
        return reponse;
    }
    async saveExaminationCalendar(formdata) {
        console.log("12345689")
        const reponse = await Repository.post(`${apiUrl}/examinationCalendar/`, formdata)
            .then(response => {
                return response.data;
            })
            .catch(error => ({ error: JSON.stringify(error) }));
        return reponse;
    }
    async editExaminationCalendar(categoryId, formdata) {
        console.log("12345689")
        const reponse = await Repository.put(`${apiUrl}/examinationCalendar/ExamId/${categoryId}`, formdata)
            .then(response => {
                return response.data;
            })
            .catch(error => ({ error: JSON.stringify(error) }));
        return reponse;
    }
    async inactiveCategory(formdata) {
        console.log("12345689")
        const reponse = await Repository.post(`${apiUrl}/examinationCalendar/status/`, formdata)
            .then(response => {
                return response.data;
            })
            .catch(error => ({ error: JSON.stringify(error) }));
        return reponse;
    }
}

export default new AuthRepository();
